function bxor(d, e)
    local f = {{0, 1}, {1, 0}}
    local g = 1
    local h = 0
    while d > 0 or e > 0 do
        h = h + f[d % 2 + 1][e % 2 + 1] * g
        d = math.floor(d / 2)
        e = math.floor(e / 2)
        g = g * 2
    end
    return h
end
local i = function(b)
    local j = {}
    local k = 1
    local l = b[k]
    while l >= 0 do
        j[k] = b[l + 1]
        k = k + 1
        l = b[k]
    end
    return j
end
local m = function(b, c)
    if #c <= 0 then
        return {}
    end
    local k = 1
    local n = 1
    for k = 1, #b do
        b[k] = bxor(b[k], string.byte(c, n))
        n = n + 1
        if n > #c then
            n = 1
        end
    end
    return b
end
local o = function(b)
